import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import NavBar from './Navbar';

const events = [];

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      eventList: events,
    };
  }

  render() {
    return (
      <main className='context'>
        <NavBar />
      </main>
    );
  }
}

export default App;
